import Link from 'next/link'

const Index = () => {
  return(
    <div>
      <Link href="/about">
        <a>About Page</a>
      </Link>
      <Link href="/stuff">
        <a>Stuff Page</a>
      </Link>
      <p>Hello Next.js</p>
    </div>
  )
}

export default Index;
